package pac.testcase.http;

import org.apache.commons.httpclient.HttpClient;
import org.apache.commons.httpclient.HttpException;
import org.apache.commons.httpclient.NameValuePair;
import org.apache.commons.httpclient.methods.PostMethod;

import java.io.IOException;

public class HttpConn {
	public static void main(String[] args) throws HttpException, IOException {
		HttpClient httpclient = new HttpClient();
		PostMethod postMethod = new PostMethod("http://open.manmanbuy.com/TestOnline.aspx");
		// 使用数组来传递参数
		NameValuePair[] postData = new NameValuePair[5];
		postData[0] = new NameValuePair(
				"__VIEWSTATE",
				"");
		postData[1] = new NameValuePair("__EVENTVALIDATION",
				"/wEWBAK7tIf3BALxztKmAQKdlNUkAqWf8+4K9HkYgpAuTRVYfc4BDSYuOzDed2E=");
		postData[2] = new NameValuePair("clasid", "57");
		// wtf
		postData[3] = new NameValuePair("ppid", "12313123");
		postData[4] = new NameValuePair("btnSearch", "提交");

		postMethod.addParameters(postData);

		postMethod.setRequestHeader(
						"User-Agent",
						"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/536.8 (KHTML, like Gecko) Chrome/20.0.1105.2 Safari/536.8");
		postMethod.setRequestHeader("Host", "open.manmanbuy.com");
		postMethod.setRequestHeader("Accept",
						"text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8");
		postMethod.setRequestHeader("Accept-Encoding", "gzip,deflate,sdch");
		postMethod.setRequestHeader("Accept-Language","zh-CN,zh;q=0.8,en;q=0.6");
		// 回车，获得响应状态码
		int statusCode = httpclient.executeMethod(postMethod);

		System.out.println(postMethod.getResponseBodyAsString());
	}
}
